import React from 'react'
import {  Routes, Route } from 'react-router-dom'
import Categores from './Categores'
import Categore from './Categore'
function RouterCategores() {
    return (
        <>
        {/* <h1 className='mt-5'>xfxfbdfbf</h1> */}
        {/* <BrowserRouter> */}
            <Routes>
                <Route path='ratue' element={<Categores />} />
                <Route path='/:categore' element={<Categore />} />
            </Routes>
        {/* </BrowserRouter> */}
        </>
    )
}

export default RouterCategores
